import React from 'react';
import  '../../index.css';
import {connect} from 'react-redux';

const TestedSamples = (props) => {
    var a = props.tested
    var b = a[a.length - 1]
    var totalTested
    for(var i in b){
        totalTested = b.totalindividualstested
    }

    return (
        <div>
            <p className="tested text-muted">{totalTested} Samples are being tested till now.</p>
        </div>
    )
}

const mapStateToProps = (state) => {
    return{
        tested: state.stats.samples
    }
}


export default connect(mapStateToProps)(TestedSamples)
